A class can extend another class, meaning that the new class inherits all of the data from the other class, and can also override its methods, add new members, etc. Inheritance is the key feature required for polymorphism . It is important to note that this feature is often overused by beginners and sometimes unnecessary hierarchies are created, adding to the overally complexity. There are some good alternatives such as composition and aggregation , although, of course, sometimes inheritance is exactly what is needed. Example: the class Rectangle can inherit from the class Polygon. You would then say that a Rectangle extends from a Polygon, or that class Rectangle is a sub-class of Polygon. In plain English, this means that a Rectangle is a more specialized version of a Polygon. Thus, all rectangles are polygons, but not all polygons are rectangles. 1.2.1 Rectangle Declaration (.h file) // File: rectangle.h #include <string> // <--- Explicitly include the string header, even though polygon.h also includes it #include "polygon.h"	// <--- You must include the declaration in order to extend the class // We extend from Polygon by using the colon (:) and specifying which type of inheritance
// will be used (public inheritance, in this case) class Rectangle : public Polygon {
private: int length; int width; // <--- NOTE: The member variables 'num_sides' and 'name' are already inherited from Polygon // it's as if we sort of get them for free, since we are a sub-class public: // Constructors explicit Rectangle(const std::string &name); Rectangle(const std::string &name, const int length, const int width); // Getters and Setters const int GetLength(void) const { return this->length; } void SetLength(const int) { this->length = length; } const int GetWidth(void) const { return this->width; } void SetWidth(const int) { this->width = width; } // <--- NOTE: Again, the getters/setters for 'num_sides' and 'name' are already inherited from Polygon // Other Methods const int Area(void) const;
}; NOTE: The inheritance access specifier (public, protected, or private) is used to determine the type of inheritance . If this is omitted then private inheritance is used by default. Public inheritance is by far the most common type of inheritance . 1.2.2 Rectangle Definition (.cpp file) // File: rectangle.cpp #include "rectangle.h"	// <--- Only need to include 'Rectangle', since 'Polygon' is included in 'rectangle.h' // This constructor calls the superclass (Polygon) constructor and sets the name and number of sides to '4', and then sets the length and width
Rectangle::Rectangle(const std::string &name, const int length, const int width) : Polygon(4, name) { this->length = length; this->width = width;
} // This constructor calls the superclass (Polygon) constructor, but sets the length and width to a constant value
// The explicit keyword is used to restrict the use of the constructor. See section below for more detail
explicit Rectangle::Rectangle(const std::string &name) : Polygon(4, name) { this->length = 1; this->width = 1;
} // Compute the area of the rectangle
int Rectangle::Area(void) const { return length * width; // <--- Note that you don't explicitly need 'this->', you can directly use the member variables
} 1.2.3 Rectangle Utilization (Another .cpp file) // File: main.cpp #include <iostream> #include "Rectangle.h" int main(int argc, char *argv[]) { Rectangle rectangle = Rectangle("Square", 6, 6); // Prints "Square has 4 sides, and an area of 36" std::cout << rectangle.GetName() << " has " << rectangle.GetNumSides() << " sides, and an area of " << rectangle.Area() << std::endl;
}

