Polymorphism describes a system in which a common interface is used to manipulate objects of different types. In essence various classes can inherit from a common interface through which they make certain guarantees about which methods/variables are available for use. By adhering to this common interface, one can use a pointer to an object of the base interface type to call the methods of any number of extending classes. Using polymorphism one can say "I don't care what type this really is; I know it implements Foo() and Bar() because it inherits from this interface", which is a pretty nifty feature. The virtual keyword is used to ensure runtime polymorphism for class methods. Additionally, an overriding method can be forced by the compiler by not providing a default implementation in the interface, which is done by setting the method to = 0, as will be shown later. 1.3.1 Motivation Let's consider a similar class hierarchy using shapes as previously discussed. Considering a shape to be any 3 or more sided polygon from which we can compute certain attributes (like the shape's area), let's extend from it to create a rectangle class from which we can set the length/width and a circle class in which you can set the radius. In both cases, we want to be able to compute the area of the shape. This is a key observation that we will expand upon later. For now, this (poorly implemented) shape class will suffice: // File: shape.h #include <cmath> // needed for M_PI constant class Shape { // We'll leave Shape empty for now... not very interesting yet
}; class Rectangle : public Shape {
private: double length; double width; public: // Constructor using a member initializer list instead of assignment in the method body Rectangle(const double w, const double l) : width(w), length(l) {} // Compute the area of a rectangle double Area(void) const { return length * width; }
}; class Circle : public Shape {
private: double radius; public: explicit Circle(double r) : radius(r) {} // Compute the area of a circle double Area(void) const { return M_PI * radius * radius; // pi*r^2 }
}; NOTE: As shown here, you can put multiple classes in a single header, although in practice unless you have a good reason for doing so it's probably best to use a separate header file per class. NOTE: I'm not using default value initialization for member variables (i.e. double length = 0;) and I'm using parentheses () instead of braces {} for the initializer list since older compilers (pre-C++11) may not support the new syntax. So, we have our two classes, Rectangle and Circle, but in this case inheriting from Shape isn't really buying us anything. To make use of polymorphism we need to pull the common Area() method into the base class as follows, by using virtual methods. 1.3.2 Virtual Methods Imagine you want to have a pointer to a shape with which you want to compute the area of that shape. For example, maybe you want to hold shapes in some sort of data structure, but you don't want to limit yourself to just rectangles or just circles; you want to support all objects that call themselves a 'Shape'. Something like: Rectangle rectangle(2.0, 5.0);
Circle circle(1.0); // Point to the rectangle
Shape * unknown_shape = &rectangle; // Could point to *any* shape, Rectangle, Circle, Triangle, Dodecagon, etc. unknown_shape->Area(); // Returns 10.0 // Point to the circle
unknown_shape = &circle;
unknown-shape->Area(); // Returns 3.14... The way to achieve this is to use the virtual keyword on the base class methods, which specifies that when a pointer to a base class invokes the method of an object that it points to, it should determine, at runtime, the correct method to invoke. That is, when unknown_shape points to a Rectangle it invokes Rectangle::Area() and if unknown_shape points to a Circle it invokes Circle::Area(). Virtual methods are employed as follows: #include <cmath> class Shape {
public: // Virtual destructor (VERY IMPORTANT, SEE NOTE BELOW) virtual ~Shape() {} // Virtual area method virtual double Area() const { return 0.0; }
}; class Rectangle : public Shape {
private: double length; double width; public: Rectangle(double w, double l) : width(w), length(l) {} // Override the Shape::Area() method with an implementation specific to Rectangle double Area() const override { return length * width; }
}; class Circle : public Shape {
private: double radius; public: explicit Circle(double t) : radius(r) {} // Override the Shape::Area() method with an implementation specific to Circle // // NOTE: there is an 'override' keyword that was introduced in C++11 and is optional: it is used // to enforce that the method is indeed an overriding method of a virtual base method at compile time // and is used as follows: double Area() const override { return M_PI * radius * radius; // pi*r^2 }
}; NOTE: It is very important that a default virtual destructor was included after adding the virtual Area() method to the base class. Whenever a base class includes even a single virtual method, it must include a virtual destructor so that the correct destructor(s) are called in the correct order when the object is eventually deleted. This is called runtime polymorphism because the decision of which implementation of the Area() method to use is determined during program execution based on the type that the base is pointing at. It is implemented using the virtual table mechanism. In a nutshell: it is a little more expensive to use but it can be immensely useful. There is also compile-time polymorphism. Here is more on the differences between them . In the example above, if a class extends from Shape but does not include an override of Area() then calling the Area() method will invoke the base class method which (in the implementation above) returns 0.0. In some cases, you may want to enforce that sub-classes implement this method. This is done by not providing a default implementation, thus making it what is called a pure virtual method. class Shape {
public: virtual ~Shape() {} virtual double Area() const = 0;
}; In general a class with only pure virtual methods and a virtual destructor is called an abstract class or interface and is typically named as such (e.g. ButtonInterface, or similar). An interface class guarantees that all extending classes implement a specific method with a specific method signature.

