1.4.1 Constructor and Destructor All classes have at least one constructor and a destructor, even if they are not explicitly defined. The constructor and destructor assist in managing the lifetime of the object. The constructor is invoked when an object is created and the destructor is invoked when an object is destroyed (either by going out of scope or explicitly using delete). The constructor establishes a class invariant , a set of assertions guaranteed to be true during the lifetime of the object, which is then removed when the destructor is called. 1.4.1.1 Use of explicit in Constructors The explicit keyword should be used in single-argument constructors to avoid a situation in which the constructor is implicitly invoked when a single argument is given in place of an object. Consider the following Array class: class Array {
private: int size; public: // Constructor Array(int size) { this->size = size; } // Destructor ~Array() {} // Print the contents of the array Print(const Array & array) { // ... }
}; The following is now legal but ambiguous: Array array = 12345; It ends up being the equivalent of this: Array array = Array(12345); Perhaps that's okay, but what about the following: array.Print(12345); Uh-oh. That's now legal, compileable code, but what does it mean? It is extremely unclear to the user. To fix this, declare the single-argument Array constructor as explicit: class Array { int size;
public: explicit Array(int size) { this->size = size; } // ...
}; Now you can only use the print method as follows: array.Print(Array(12345)); and the previous array.Print(12345) is now a syntax error. 1.4.1.2 Member Initializer Lists Member initializer lists allow you to initialize member variables in the definition of a method. This turns out to provide some performance benefits for class-type member variables, since a call to the default constructor is avoided. For POD (plain old data) like ints and floats, though, it is the same as initializing them in the body of the method. class Car {
private: int year; int miles; std::string make; public: Car(const int year, const int miles, const std::string & make) : year(year), miles(miles), make(make) {}
}; Using the initializer list is basically the same as the following more verbose constructor implementation, notwithstanding the note above regarding performance: Car(const int year, const int miles, const std::string & make) { this->year = year; this->miles = miles; this->make = make;
} Since C++11 initializer lists have some added functionality and curly braces {} can be used instead of parentheses () in the initializer list, but to maintain compatibility with older compilers you may want to use parentheses. The same applies in general to initialization syntax when creating objects. Many people prefer braces, and in some cases it's necessary (e.g. vector containing [100, 1] or a vector of one hundred 1s?), but to support older compilers you may consider using parentheses. 1.4.2 new and delete The new and delete operators (and their array counterparts, new[] and delete[]) are operators used to dynamically allocate memory for objects, much like C's malloc() and free(). More on these operators can be found here . When manually allocating memory dynamically, it is the responsibility of the programmer to manage the memory and properly delete objects that have been allocated. 1.4.3 Copy Constructor and Copy Assignment Copy constructors and copy assigment operators allow one object to be constructed or assigned a copy of another object directly: Foo a(10);
Foo b(a); // (1): Copy via constructor
Foo c ;
c = a;	// (2): Copy via assignment operator This is accomplished by supplying a copy constructor and an assigment operator overload, both of which have a special syntax where they accept a const reference to an object of their same type. class Foo {
private: int data; public: // Default (no argument) constructor Foo() : data(0) {} // Single argument constructor explicit Foo(const int v) : data(v) {} // Copy constructor Foo(const Foo & f) : data(f.data) {} // Copy assignment operator Foo & operator=(const Foo & f) { data = f.data; return *this; }
}; Note that the compiler will always provide a default constructor, a default copy constructor, and a default copy assignment operator, so for simple cases (like this trivial example) you will not have to implement them yourself. More info on this can be found here . 1.4.4 Move Constructor and Move Assignment Sometimes instead of performing a copy you instead wish to completely move data from one object to another. This requires the use of a move constructor and move assignement operator. class Movable {
private: Foo * data_ptr; public: Movable(Foo data) : data_ptr(new Foo(data)) {} // Move constructor Movable(Movable && m) { // Point to the other object's data data_ptr = m.data_ptr; // Remove the other object's data pointer by // setting it to nullptr m.data_ptr = nullptr; } // Move assignment operator Movable & operator=(Movable && m) { data_ptr = m.data_ptr; m.data_ptr = nullptr; return *this; } ~Movable() { delete data_ptr; }
}; The move constructor and assignment operator can be used as follows: Movable Bar() { // ...
} int main() { Movable a(Bar()); // Using the move constructor Movable b = Bar(); // Using the move assignment operator
} Since Bar() creates an object that won't be used elsewhere and is deleted after the call, we can use the move constructor or move assignment operator to move the data to our object. A programming idiom called 'copy and swap' makes use of the move constructor and can be a useful idiom.

