Operators such as +, -, *, etc. are familiar and ubiquitous when working with simple data types like integers and floating point numbers. These operators as well as others can also be overloaded to provide a clear syntactic meaning to your own classes. For example, when working with linear algebra you can overload the + operator to perform an element-wise addition of two vectors. Here's a brief example using complex numbers that allows you to use the + and - operators to easily add and subtract two complex numbers. There are two main ways to do operator overloading. The first is using normal member functions. The second uses the friend keyword and non-member methods that have access to the private member variables of the class. Using normal member functions (requires a getter method for the member variables): // File: complex.h class Complex {
private: double r = 0.0; // Real part, defaults to 0.0 double i = 0.0; // Imaginary part, defaults to 0.0 public: Complex(const double r, const double i) : r(r), i(i) {} // Accessor methods double GetReal(void) const { return r; } double GetImaginary(void) const { return i; } // + Operator Complex operator+(const Complex & a, const Complex & b) { return Complex(a.GetReal() + b.GetReal(), a.GetImaginary() + b.GetImaginary()); } // - Operator Complex operator-(const Complex& a, const Complex& b) { return Complex(a.GetReal() - b.GetReal(), a.GetImaginary() - b.GetImaginary()); }
}; Using friend methods: // File: complex.h class Complex {
private: double r = 0.0; // Real part, defaults to 0.0 double i = 0.0; // Imaginary part, defaults to 0.0 public: Complex(const double r, const double i) : r(r), i(i) {} // + Operator (declaration only) friend Complex operator+(const Complex & a, const Complex & b); // - Operator (declaration only) friend Complex operator-(const Complex& a, const Complex& b);
}; // These are NOT member functions
// They can also be defined inside the class body but leaving them outside
// is a clearer reminder that they are not part of the class
Complex operator+(const Complex & a, const Complex & b) { return Complex(a.r + b.r, a.i + b.i);
} Complex operator-(const Complex& a, const Complex& b) { return Complex(a.r - b.r, a.i - b.i);
} In either case, the new operators can be used as follows: int main() { Complex a(1, 2); // 1 + 2i Complex b(5, 3); // 5 + 3i Complex c = a + b;	// 6 + 5i Complex d = a - b;	// -4 - 1i
} It's also often useful to overload the output stream operator to provide a custom output string displaying the object's internal state in a human-readable format. This is done by overloading the << operator and requires using the <iostream> functionality. #include <iostream> class Complex {
private: // ...
public: // ... friend std::ostream & operator<<(std::ostream & os, const Complex & c);
}; // Definition
// Again, this is NOT a member function!
std::ostream & operator<<(std::ostream & os, const Complex & c) { os << c.r << " + " << c.i << "i"; return os;
} int main() { Complex a {1, 2}; Complex b {5, 3}; std::cout << a; // Prints: 1 + 2i std::cout << a + b; // Prints: 6 + 5i
} You can also similiarly overload the input stream operator (>>), and can read more about the various operators here .

