Templates are a very powerful abstraction allowing you to generate compile-time methods/classes/etc. for any number of types while writing only one implementation. Say you have a method that adds two floating point number together, and another to add two integers together: double Add(const double a, const double b) { return a + b;
} int Add(const int a, const int b) { return a + b;
} That's great, but since both floating point numbers and integers implement the + operator you can use a template to instead write one generic implementation of a method that can operate on doubles, ints, floats, and (in this case) any other type that implements the + operator. A simple templatized version of Add would look something like this: template <typename T> // T becomes whatever type is used at compile-time
T Add(const T & a, const T & b) { return a + b; // The type T must support the + operator
} // Usages
int main() { Add<int>(3, 5); // int version Add<double>(3.2, 5.8); // double Add(3.45f, 5.0f); // implicit float version: we leave off the <float> here, since it can deduce the type from the context Complex a {1, 2}; // Custom class Complex b {5, 3}; Add(a, b); // Works because we added support for the + operator!
} In this simple example the compiler would generate four different methods, one for each type. Templating allows you to write more concise and modular code at the expense of generating a larger executable (code bloat). Templates are especially useful to create class templates. Class templates must be completely defined in a single header file. // File: storage.h template <class T> // <--- 'class' is synonymous with 'typename'
class Container {
private: T data;
public: explicit Container(const T & d) : data(d) {}
}; // Usage
int main() { Container<int> a(1); Container<float> b(10.0f); Container<Container<int>> c(a);
} NOTE: More coming soon on templates... Read more about templates here and here .

